import React from 'react';
import { useSelector } from 'react-redux';

const NewProduct = () => {

    function formatNumber(number) {
        var numString = number.toString()
        var result = ''
        while (numString.length > 3) {
            var chunk = numString.substr(-3)
            numString = numString.substr(0, numString.length - 3)
            result = ',' + chunk + result
        }

        if (numString.length > 0) {
            result = numString + result
        }

        return result
    }

    const product = useSelector((state) => state.allProduct.product);

    const renderList = product.map((product) => {
        const {
            id, maSP, tenSP, giaSP, urlAnhSanPham, size, soluong, ngayThem, mota,
            review, xuatXu, baoHanh, kichThuoc, giaKhuyenMai,
            trangThai, danhmucNavigation, thuongHieuNavigation,
            chatLieuNavigation, khuyenMaiNavigation, danhMucHinhNavigation,
        } = product;
        return (
            <div className="item text-center col-20" key={id}>
                <div className="product-miniature js-product-miniature item-one first-item">
                    <div className="thumbnail-container">
                        <a href="product-detail.html">
                            <img className="img-fluid image-cover" style={{ width: '227.8px', height: '227.8px', objectFit: 'contain' }} src={urlAnhSanPham} alt="img" />
                            <img className="img-fluid image-secondary" src={danhMucHinhNavigation[0].urlAnh} style={{ width: '227.8px', height: '227.8px', objectFit: 'contain' }} alt="img" />
                        </a>
                        <div className="highlighted-informations">
                            <div className="variant-links">
                                <a href="#" className="color beige" title="Beige" />
                                <a href="#" className="color orange" title="Orange" />
                                <a href="#" className="color green" title="Green" />
                            </div>
                        </div>
                    </div>
                    <div className="product-description">
                        <div className="product-groups">
                            <div className="product-title">
                                <a href="product-detail.html">{tenSP}</a>
                            </div>
                            <div className="rating">
                                <div class="star-content" style={{ marginTop: '6px', color: 'green', fontSize: '15px' }}>
                                    <span className="info-stock">
                                        <i className="fa fa-check-square-o" aria-hidden="true" />
                                        {
                                            soluong > 0 ? "Còn hàng" : "Hết hàng"
                                        }
                                    </span>
                                </div>
                            </div>
                            <div className="product-group-price">
                                <div className="product-price-and-shipping">
                                    <span className="price">{formatNumber(giaSP)} vnđ</span>
                                </div>
                            </div>
                        </div>
                        <div className="product-buttons d-flex justify-content-center">
                            <form action="#" method="post" className="formAddToCart">
                                <input type="hidden" name="id_product" defaultValue={1} />
                                <a className="add-to-cart" href="#" data-button-action="add-to-cart">
                                    <i className="fa fa-shopping-cart" aria-hidden="true" />
                                </a>
                            </form>
                            {/* <a className="addToWishlist" href="#" data-rel={1} onclick>
                            <i className="fa fa-heart" aria-hidden="true" />
                        </a> */}
                            <a href="#" className="quick-view hidden-sm-down" data-link-action="quickview">
                                <i className="fa fa-eye" aria-hidden="true" />
                            </a>
                        </div>
                    </div>
                </div>
            </div>
        );
    })

    return (
        <> {renderList} </>
    );
};

export default NewProduct;
